import React from "react";
import NAvbsr from "./NAvbsr";
import photo from "./images/photo.png";
import EditLocationIcon from "@mui/icons-material/EditLocation";
import CallIcon from "@mui/icons-material/Call";
import AttachEmailIcon from "@mui/icons-material/AttachEmail";

function Resume() {
  return (
    <>
      <NAvbsr />
      <div className="resume row">
        <div className="col-lg-4 resume_profile_photo_component">
          <img src={photo} alt="" className="resume_profile_photo" />
        </div>
        {/* <div className="col-lg-1"></div> */}

        <div className="col-lg-8">
          <h1>PRITAM MULI</h1>
          <div className="row">
            <div className="col-lg-6">
              <CallIcon className="contact_icons" /> +91 9765129019
            </div>
            <div className="col-lg-6">
              <EditLocationIcon className="contact_icons" /> Garakheda parisar
              Sambhaji nagar
            </div>
            <div className="col-lg-6">
              <AttachEmailIcon className="contact_icons" />{" "}
              muli.pritam@gmail.com
            </div>
          </div>
        </div>
      </div>
    </>
  );
}

export default Resume;
